import React from 'react';
import '../App.css';

export default function Keyboard() {
    const keys1 = ["Q", "W", "E", "R", "T", "Y", "U", "I", "O", "P"];
    const keys2 = ["A", "S", "D", "F", "G", "H", "J", "K", "L"];
    const keys3 = ["Z", "X", "C", "V", "B", "N", "M"];

    return (
        <div className = "keyboard"> 
            <div className = "line1">
                {keys1.map((key) => {
                    return <div className = "key"> {key} </div>
                })}
            </div>
            <div className = "line2">
                {keys2.map((key) => {
                    return <div className = "key"> {key} </div>
                })}
            </div>
            <div className = "line3">
                <div className = "key" id = "big" onClick = {selectLetter}> 
                    ENTER 
                </div>
                {keys3.map((key) => {
                    return <div className = "key"> {key} </div>
                })}
                <div className = "key" id = "big"> DELETE </div>
            </div>
        </div>
    )

}
